import React, { useState, useEffect } from 'react';

const WordAnalyzer = () => {
  const [inputWord, setInputWord] = useState('');
  const [suggestions, setSuggestions] = useState([]);
  const [currentYear, setCurrentYear] = useState(new Date().getFullYear());

  useEffect(() => {
    // Fetch dictionary data when component mounts
    fetch('dictionary.txt')
      .then((response) => response.text())
      .then((dictionaryData) => {
        const dictionary = dictionaryData.split('\n').map((word) => word.toLowerCase().trim());

        // Handle word check on button click
        const handleCheckButtonClick = () => {
          if (inputWord.trim() === '') return;

          const suggestions = spellCheck(inputWord.toLowerCase(), dictionary);
          setSuggestions(suggestions);
        };

        document.getElementById('check-button').addEventListener('click', handleCheckButtonClick);
      });
  }, [inputWord]);

  const spellCheck = (userInput, dictionary) => {
    const suggestions = [];
    for (const word of dictionary) {
      const minPenalty = calculateAlignmentPenalty(userInput, word);
      suggestions.push({ word, penalty: minPenalty });
    }
    suggestions.sort((a, b) => a.penalty - b.penalty);
    return suggestions.slice(0, 10).map((item) => item.word);
  };

  const calculateAlignmentPenalty = (a, b) => {
    const lengthFirst = a.length;
    const lengthSecond = b.length;
    const costArray = new Array(lengthFirst + 1).fill(null).map(() => new Array(lengthSecond + 1).fill(0));

    for (let i = 0; i <= lengthFirst; i++) {
      costArray[i][0] = i;
    }

    for (let j = 0; j <= lengthSecond; j++) {
      costArray[0][j] = j;
    }

    for (let i = 1; i <= lengthFirst; i++) {
      for (let j = 1; j <= lengthSecond; j++) {
        const cost = calculatePenalty(a[i - 1], b[j - 1]);
        costArray[i][j] = Math.min(
          costArray[i - 1][j - 1] + cost,
          costArray[i - 1][j] + 2, // Gap
          costArray[i][j - 1] + 2 // Detectors
        );
      }
    }
    return costArray[lengthFirst][lengthSecond];
  };

  const calculatePenalty = (a, b) => {
    if (a === b) return 0;
    if ((isVowel(a) && isVowel(b)) || (!isVowel(a) && !isVowel(b))) return 1;
    return 3;
  };

  const isVowel = (char) => 'aeiou'.indexOf(char) !== -1;

  return (
    <div>
      <h1>Word Analyzer</h1>
      <div className="copyright">
        &copy; <span>{currentYear}</span> <a href="https://logannitzsche.com">Logan Nitzsche</a>
      </div>
      <div className="input-container">
        <br />
        <h4>Enter Word: </h4>
        <input
          type="text"
          id="input-word"
          placeholder="Type a word"
          value={inputWord}
          onChange={(e) => setInputWord(e.target.value)}
        />
        <button id="check-button">Check</button>
      </div>
      <div className="suggestions">
        <h2>Suggestions:</h2>
        <ul id="suggestion-list">
          {suggestions.map((suggestion, index) => (
            <li key={index} style={{ listStyleType: 'none' }}>
              <span style={{ fontWeight: 'bold' }}>{suggestion}</span>
              <span style={{ marginLeft: '10px' }}>
                <a href={`https://www.dictionary.com/browse/${suggestion}`} target="_blank" rel="noopener noreferrer">
                  Dictionary
                </a>{' '}
                |{' '}
                <a href={`https://www.thesaurus.com/browse/${suggestion}`} target="_blank" rel="noopener noreferrer">
                  Thesaurus
                </a>{' '}
                |{' '}
                <a
                  href={`https://www.rhymezone.com/r/rhyme.cgi?Word=${suggestion}&typeofrhyme=perfect&org1=syl&org2=l&org3=y`}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Rhyme Zone
                </a>{' '}
                |{' '}
                <a
                  href={`https://trends.google.com/trends/explore?date=now%201-d&geo=US&q=${suggestion}&hl=en`}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Google Trends
                </a>
              </span>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default WordAnalyzer;
